CREATE TABLE "menu_menuitem" ("id_menu_item" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "url_name" varchar(100) NOT NULL, "query_params" varchar(200) NOT NULL, "icon" varchar(50) NOT NULL, "is_collapse" bool NOT NULL, "order" integer NOT NULL, "heading_id" integer NULL REFERENCES "menu_menuheading" ("id_menu_heading") DEFERRABLE INITIALLY DEFERRED, "parent_id" integer NULL REFERENCES "menu_menuitem" ("id_menu_item") DEFERRABLE INITIALLY DEFERRED)

